import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the first product card
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product details from modal
    const productDetails = await page.evaluate(() => {
      const titleElement = document.querySelector('.product-detail-title');
      const priceElement = document.querySelector('.product-detail-price');
      const ratingElement = document.querySelector('.product-detail-rating .stars');

      return {
        title: titleElement ? titleElement.textContent : null,
        price: priceElement ? priceElement.textContent : null,
        rating: ratingElement ? ratingElement.textContent : null
      };
    });

    return {
      success: true,
      action: "Successfully opened product detail modal by clicking on a product card",
      extractedData: productDetails,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
